import React, { Component } from 'react'
import NothingBlock from './nothing_block'
import AddTaskBlock from './add_task_block'
import RegisterBlock from './register_block'
import LoginBlock from './login_block'

export default class RightSide extends Component {
  constructor(props){
    super(props)
    this.state = {
      display: false
    }
  }
    render() {
        return (
<div className="col-xl-6 col-lg-6 col-md-6">
          <div className="card">
            <div className="card-body" id="content">

                <NothingBlock />
                <AddTaskBlock />
                <RegisterBlock />
                <LoginBlock login_user_func={this.props.login_user_func}
                            auth={this.props.auth} />

              

              

              
            </div>
          </div>
        </div>
        )
    }
}
